import React from 'react';
import { motion } from 'framer-motion';

// Icons for technologies
import { FaReact, FaNodeJs, FaJs, FaDatabase, FaGitAlt } from 'react-icons/fa';
import { SiTypescript, SiNextdotjs, SiExpress, SiMongodb, SiPostgresql, SiGraphql, SiTailwindcss, SiRedux, SiDocker, SiGithub, SiFigma, SiAdobexd } from 'react-icons/si';

// Custom colors for icons
const iconColors = {
  react: '#61DAFB',
  nextjs: '#000000',
  javascript: '#F7DF1E',
  typescript: '#3178C6',
  tailwind: '#06B6D4',
  redux: '#764ABC',
  node: '#68A063',
  express: '#000000',
  mongodb: '#47A248',
  postgresql: '#336791',
  graphql: '#E10098',
  docker: '#2496ED',
  git: '#F05032',
  github: '#181717',
  figma: '#F24E1E',
  xd: '#FF26BE',
  default: '#4B5563'
};

const TechStack = () => {
  const techCategories = [
    {
      category: 'Frontend',
      skills: [
        { name: 'React', icon: <FaReact className="w-8 h-8" style={{ color: iconColors.react }} />, level: 90 },
        { name: 'Next.js', icon: <SiNextdotjs className="w-8 h-8" style={{ color: iconColors.nextjs }} />, level: 85 },
        { name: 'JavaScript', icon: <FaJs className="w-8 h-8" style={{ color: iconColors.javascript }} />, level: 90 },
        { name: 'TypeScript', icon: <SiTypescript className="w-8 h-8" style={{ color: iconColors.typescript }} />, level: 85 },
        { name: 'Tailwind CSS', icon: <SiTailwindcss className="w-8 h-8" style={{ color: iconColors.tailwind }} />, level: 90 },
        { name: 'Redux', icon: <SiRedux className="w-8 h-8" style={{ color: iconColors.redux }} />, level: 80 },
      ]
    },
    {
      category: 'Backend',
      skills: [
        { name: 'Node.js', icon: <FaNodeJs className="w-8 h-8" style={{ color: iconColors.node }} />, level: 85 },
        { name: 'Express', icon: <SiExpress className="w-8 h-8" style={{ color: iconColors.express }} />, level: 85 },
        { name: 'MongoDB', icon: <SiMongodb className="w-8 h-8" style={{ color: iconColors.mongodb }} />, level: 80 },
        { name: 'PostgreSQL', icon: <SiPostgresql className="w-8 h-8" style={{ color: iconColors.postgresql }} />, level: 75 },
        { name: 'GraphQL', icon: <SiGraphql className="w-8 h-8" style={{ color: iconColors.graphql }} />, level: 75 },
        { name: 'Docker', icon: <SiDocker className="w-8 h-8" style={{ color: iconColors.docker }} />, level: 70 },
      ]
    },
    {
      category: 'Tools',
      skills: [
        { name: 'Git', icon: <FaGitAlt className="w-8 h-8" style={{ color: iconColors.git }} />, level: 85 },
        { name: 'GitHub', icon: <SiGithub className="w-8 h-8" style={{ color: iconColors.github }} />, level: 85 },
        { name: 'Figma', icon: <SiFigma className="w-8 h-8" style={{ color: iconColors.figma }} />, level: 75 },
        { name: 'Adobe XD', icon: <SiAdobexd className="w-8 h-8" style={{ color: iconColors.xd }} />, level: 70 },
      ]
    }
  ];

  return (
    <section id="tech" className="py-20 bg-skin-50 relative overflow-hidden">
      {/* Decorative elements */}
      <div className="absolute inset-0 overflow-hidden opacity-20">
        <div className="absolute -top-32 -left-32 w-64 h-64 bg-green-200 rounded-full mix-blend-multiply filter blur-xl opacity-20"></div>
        <div className="absolute -bottom-32 -right-32 w-64 h-64 bg-green-300 rounded-full mix-blend-multiply filter blur-xl opacity-20"></div>
      </div>

      <div className="container mx-auto px-4 relative z-10">
        <div className="text-center mb-16">
          <h2 className="text-4xl md:text-5xl font-bold mb-4 text-black-900">
            My Tech Stack
          </h2>
          <div className="w-24 h-1 bg-gradient-to-r from-green-500 to-green-700 mx-auto rounded-full"></div>
        </div>

        <p className="mt-6 text-lg text-gray-600 max-w-2xl mx-auto">
          Here are the technologies and tools I work with on a regular basis.
        </p>

        <div className="grid grid-cols-1 lg:grid-cols-3 gap-8 max-w-6xl mx-auto">
          {techCategories.map((category, catIndex) => (
            <motion.div 
              key={catIndex} 
              className="glass-card p-8 rounded-2xl bg-white/70 border border-green-100/50"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ duration: 0.5, delay: 0.1 }}
            >
              <h3 className="text-2xl font-bold mb-6 text-black-900">{category.category}</h3>
              <div className="grid grid-cols-2 md:grid-cols-3 gap-6">
                {category.skills.map((skill, index) => (
                  <motion.div 
                    key={index}
                    className="flex flex-col items-center p-4 rounded-xl bg-white/80 backdrop-blur-sm hover:bg-white/90 transition-colors duration-300 border border-green-100"
                    whileHover={{ y: -5, boxShadow: '0 10px 25px -5px rgba(0, 0, 0, 0.05)' }}
                    initial={{ opacity: 0, y: 20 }}
                    whileInView={{ opacity: 1, y: 0 }}
                    viewport={{ once: true }}
                    transition={{ duration: 0.3, delay: index * 0.1 }}
                  >
                    <div className="mb-3 p-3 rounded-full bg-white shadow-sm border border-green-50">
                      {skill.icon}
                    </div>
                    <h4 className="font-semibold text-black-800 mb-2">{skill.name}</h4>
                    <div className="w-full bg-green-100 rounded-full h-2.5 overflow-hidden">
                      <div 
                        className="bg-gradient-to-r from-green-500 to-green-700 h-2.5 rounded-full transition-all duration-1000 ease-out" 
                        style={{ width: `${skill.level}%` }}
                        initial={{ width: 0 }}
                        animate={{ width: `${skill.level}%` }}
                        transition={{ duration: 1, delay: 0.5 + (index * 0.1) }}
                      ></div>
                    </div>
                    <span className="text-xs text-green-700 mt-1 font-medium">{skill.level}%</span>
                  </motion.div>
                ))}
              </div>
            </motion.div>
          ))}
        </div>
      </div>

      {/* Back to top link */}
      <div className="fixed right-10 top-1/2 transform -translate-y-1/2 rotate-90 origin-right text-sm text-gray-500 hover:text-gray-800 transition-colors z-50">
        <a href="#" className="flex items-center">
          BACK TO TOP
        </a>
      </div>
    </section>
  );
};

export default TechStack;
